import React from 'react';
import './App.css';
import Home from "./home/Home";
import SimpleMap from "./SimpleMap";
import EmailUs from "./EmailUs";

function App() {
  return (
    <div>
      <header>
          <Home/>
      </header>
        <SimpleMap/>
        <EmailUs/>
    </div>
  );
}

export default App;
